import './App.css';
import Login1 from './Components/Login1';
import notFound from './Components/notFound';

import { BrowserRouter as 
Router,
Route,
Link,
Switch,
Redirect 
}
 from 'react-router-dom';


function App() {
  return (
    <Router>
      <Switch>   
      <Route exact path='/Component/Login1' component={notFound}/>
      <Route exact path='Component/notFound' component={notFound}/>
      <Redirect to="/notFound"/>
    </Switch>
  </Router>


  );
}






export default App;
